import React from 'react';

const OfflineSensors = ({ offlineSensors }) => {
  return (
    <div>
      <h2>Offline Sensors</h2>
      <ul>
        {offlineSensors.map(sensor => (
          <li key={sensor.id}>
            {sensor.name} - ID: {sensor.id}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default OfflineSensors;
